INSERT INTO `myservices` VALUES (1,'ล้างแอร์','การล้างแอร์ธรรมดา\n เป็นการล้างแอร์บ้านตามมาตรฐานทั่วไป มีขั้นตอนการถอดหน้ากากโครงแอร์ ถอดโบว์เวอร์ ถอดท่อน้ำทิ้ง และอุปกรณ์อื่นๆ นำมาทำความสะอาด ซึ่งตามเทคนิคของช่างโดยทั่วไป เราจะเห็นการล้างคอยล์เย็นแบบมีผ้าคลุมฉีดล้างทั่วไป แต่ที่ฮิปโปแอร์ เราเน้นการบริการลูกค้า แบบพรี่เมี่ยม ทั้งการล้างแอร์แบบพิถีพิถัน การดูแลทรัพย์สินลูกค้า และการบริการลูกค้าอีกด้วย\n\nข้อดีของการล้างแอร์ธรรมดา\n1.ลดค่าไฟ และยังช่วยลดการสะสมของฝุ่นละอองที่อยู่ในตัวเครื่อง\n\n2.ช่วยยืดอายุการใช้งาน การล้างแอร์เป็นวิธีหนึ่งที่ช่วยให้มีประสิทธิภาพของการทำงานเครื่องให้ดีขึ้น\n\n3.ช่วยขจัดกลิ่นเหม็น ทำให้อากาศที่ออกมาจากเครื่องแอร์สดชื่น ทำให้แอร์เย็นฉ่ำมากขึ้นกว่าเดิม',500,1),(2,'เปิดประตู้ห้อง(ลืมกุญแจ)','XXXXXX',50,1),(3,'ทำความสะอาดห้อง','หฟกดฟหก',800,1),(4,'ล้างแอร์แขวน','dasfd',1000,1),(5,'ซ่อมไฟ','XXXXX',40,1);
/*!40000 ALTER TABLE `myservices` ENABLE KEYS */;
